  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0112760 includes chemical,
  physical and underway - surface data collected from A. V. HUMBOLDT, ARANDA, FINNPARTNER
  and Finnmaid in the Baltic Sea, Gulf of Bothnia, Gulf of Finland and Gulf of Riga
  from 1995-10-11 to 2011-11-28 and retrieved during cruise BS-1995_10 - BS-2011-11.
  These data include Partial pressure (or fugacity) of carbon dioxide, SALINITY and
  SEA SURFACE TEMPERATURE. The instruments used to collect these data include Carbon
  dioxide (CO2) gas analyzer and Shower head chamber equilibrator for autonomous carbon
  dioxide (CO2) measurement. These data were collected by Bernd Schneider and Bernd
  Sadkowiak of Leibniz Institute for Baltic Sea Research as part of the Baltic Sea
  data set.nnThe Global Volunteer Observing Ship (VOS) Program is coordinated by the
  UNESCO International Ocean Carbon Coordination Project (IOCCP). International groups
  from 14 countries have been outfitting research ships and commercial vessels with
  automated CO2 sampling equipment to analyze the carbon exchange between the ocean
  and atmosphere.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
